          "baths_half": 1,
          "text": "Exquisite Old Metairie Oasis with Saltwater Pool is a must see. Welcome to your own private retreat in the heart of Old Metairie! This stunning home combines timeless elegance with modern amenities, offering the perfect blend of comfort and luxury. As you enter, you're immediately drawn to the expansive backyard with pergola and featuring an oversized saltwater pool. Whether you're hosting lively gatherings or enjoying peaceful evenings under the stars, this outdoor space is an entertainer's dream come true. Step inside to discover a wealth of upgrades and character throughout. First the stunning slate floors are beautiful and adorn the entire lower floor. The gourmet kitchen boasts granite countertops, stainless steel appliances, and custom cabinets, creating a stylish and functional space for culinary enthusiasts. A built-in window seat with storage adds a charming touch, perfect for sipping morning coffee or enjoying a good book. The main level boasts 9' ceilings, a wood-burning fireplace with a custom mantel, and crown molding, creating an inviting atmosphere for gatherings with loved ones. The family room is wired for surround sound and features recessed speakers, offering the ultimate entertainment experience. Double insulated windows flood the home with natural light while providing energy efficiency. Conveniently located just blocks away from Pontiff Park, enjoy easy access to outdoor recreation and leisure activities. With its prime location, exceptional upgrades, and unparalleled charm, this Old Metairie home offers a lifestyle of luxury and convenience. Don't miss your chance to own this exceptional property. Schedule your private showing today and experience the epitome of Southern living!",
