          "name": null,
          "baths_half": null,
          "text": "HGTV Inspired! Beautifully renovated home in the heart of OLD METAIRIE. On trend design features Arhaus lighting, gleaming hardwood floors, Sherwin Williams paint and custom closets! Well appointed kitchen w/ Quartz, stainless steel appliances, white cabinetry, farmhouse sink, brushed gold hardware, office nook and pantry. FIRST FLOOR primary bedroom adorned w/ stunning chandelier and large WIC. Stylish bathroom renovations including elegant tile showers, chic vanities, mirrors & lighting. Generous bedrooms (all with custom closets) and plenty of living space options including bonus/flex room, deck & charming patio area. RARE FIND w/ motorized gated off street parking (3+), additional driveway and a spacious GARAGE w/ secured storage area. Updated kitchen, baths, plumbing, electrical, hardwood flooring, interior/exterior paint, lighting, doors, ductwork, landscaping, window boxes & more. FIRST FLOOR LAUNDRY. Trane AC. All thats left to do is MOVE IN. Eye catching curb appeal located in a coveted tree lined neighborhood just steps from lively METAIRIE ROAD shops & dining.",
