          "name": null,
          "baths_half": 1,
          "text": "This stunning split-level home does not disappoint! From the moment you walk in the door, the neutral color palette, beautiful flooring throughout, and the massive wood burning fireplace will wow you! So light and bright inside! There are two primary bedrooms. One is conveniently on the bottom level and the other is on the 2nd level along with its ensuite bath and an additional full bathroom with three more bedrooms. Walk in closets, no carpet, vaulted ceilings, and a kitchen and breakfast area that will inspire you to cook and eat in! A large bonus room is also on the first floor that can be anything you want it to be. Playroom, kid's den or game room, office, or even sixth bedroom. Endless possibilities. Stepping outside, there is abundant, well-taken care of decking and a pool! The entire back yard oasis was created for entertaining and sharing moments with friends and family. Wait until you see the big workshop or shed in back with electricity! Fully fenced yard and low flood insurance. Roof is 6 years old. Lafreniere Park is nearby as well as restaurants and retail shops.",
