          "name": null,
          "baths_half": 2,
          "text": "Beautiful home in sought after Pontchartrain Shores subdivision. This freshly-painted, corner lot home is close to the levee and the lake for your outdoor walks and rides. This brick home features 4 bedrooms, 3.5 baths + Bonus room to be used as an office/playroom or turned into another bedroom. The primary suite is located downstairs and provides a sanctuary of comfort with a wood burning fireplace that faces both the bedroom & the living room. The newly renovated primary bath features a deep freestanding, oval, soaking tub with separate shower that promises relaxation after a long day. The walk-in primary closet provides ample custom cabinetry with lots of space for your wardrobe and belongings. The large office/playroom is also located downstairs. The grand dining room off the kitchen area is great for entertaining. Beautiful open concept in the kitchen that opens into the family room. Kitchen features granite counters and stainless steel appliances with a double oven. Huge kitchen pantry. Over-sized laundry room with lots of cabinet storage space. Family room and breakfast room have a wall of windows for exceptional views to showcase the covered patio and lush green space, providing a serene backdrop for relaxation or outdoor activities, with a built in pond and pretty camelias & azaleas. The large side yard also has room for a boutique pool or swing set. Great storage in this home with upstairs attic access. Single car, attached garage. New roof, gutters and water heater. 2 AC systems & newer double paned windows. Termite contract & alarm system. Every detail of this home has been carefully curated to offer a lifestyle of luxury and convenience.",
