          "name": null,
          "baths_half": 1,
          "text": "Welcome to modern luxury living in the heart of Delimon Place in the Upper Pontalba Condominiums. This meticulously renovated 2 bedroom, 2.5 bath corner unit redefines sophistication and elegance, offering a seamless fusion of contemporary design and timeless charm. The interior has been completely transformed, with every detail carefully curated by a talented local designer. The unit was gutted to the studs in 2019 with all new electrical, plumbing, windows and doors, ensuring that every aspect of the space exudes quality and craftsmanship. Crown molding and wood floors add warmth and character to the spacious feel of the unit. The exquisite kitchen boasts Taj Mahal quartzite counters that exude sophistication. The indulgence continues in the marble-clad bathrooms, where luxury meets functionality. Both baths feature marble finishes and walk in closets. The primary bathroom boasts a spacious walk-in marble shower. The second bedroom offers versatility and comfort, ideal for guests or as a home office or second den. Step outside onto the lovely balcony for some fresh air and keep your green thumb in check! This corner unit overlooks the newly constructed walking path on Canal Street, offering a picturesque backdrop among the trees for al fresco dining or simply unwinding with a cup of coffee. In summary, this designer-renovated condo unit epitomizes luxury living at its finest. From the gourmet kitchen with Taj Mahal counters to the marble baths and wood floors, every detail has been thoughtfully crafted to provide the ultimate in comfort, style, and sophistication. Welcome home to Delimon Place, where luxury meets lifestyle.",
