          "name": null,
          "baths_half": null,
          "text": "Don't miss the opportunity to move right into a desirable Metairie neighborhood in this beautifully updated and well-maintained home with an open floor plan that is great for entertaining! It features beautiful Brazilian cherry wood floors throughout the living/dining area, travertine in bathrooms and sunroom, ample lighting, granite countertops, a huge sunroom with central air/heat and a finished garage with central air/heat that could be used as a playroom or workout room. All rooms have double-insulated windows that come with a transferable lifetime warranty and spray foam in the attic that help keep the utility bills down. There is an additional covered patio behind the sunroom with a hot tub that opens up to a spacious backyard with a beautiful new cedar privacy fence creating your own private oasis. It provides quick access to Interstate and downtown New Orleans, and it is walking distance to shopping, restaurants, and the Metairie Mardi Gras parades on Veterans Blvd! Back on market after buyer's financing fell through!",
