          "name": null,
          "baths_half": null,
          "text": "Charming and modern renovated 3-bedroom 2 bath. 30-year architectural shingle roof. Updated plumbing including under the slab plumbing. Lifeproof luxury vinyl plank in all 3 bedrooms, and ceramic tile everywhere else. New lifetime-rated exterior paint, and fresh painted interior walls, molding, and doors. The new A/C unit connects to the Nest smart thermostat. The kitchen was updated with ample storage and the pantry space includes a built-in front-loading laundry station. All appliances to remain! The master bedroom features pocket doors that lead to an updated master bathroom and walk-in closet with a built-in drawer and shelf system. 300 sq.ft. patio and 12x16 rear building which is perfect as a detached Work-from-Home Office, Recreation Room, Workshop, or She-Shed! The custom-designed rear building sits proudly under a mature oak tree (and next to mature Satsuma & Japanese plum trees), and offers both form and function with its residential door, 3 residential windows, 6ft wide double side door, walkable roof with 30 year shingles, vaulted ceiling with 3 overhead lights on individual dimmers, 9 interior electrical outlets, 2 exterior outlets, 12, 000BTU ductless/mini-split Air and Heat, exterior dusk-to-dawn light, and peg board interior walls! Monitor the security of your entire home with the WiFi camera system and Wireless home security system with 3-day battery back-up that includes a monitored smoke alarm (home insurance discount!), all controllable on your phone. Termite contract in place since 2015. Transferable flood policy is $964/year. Dont forget that in 2019, Jefferson Parish completed a total reconstruction of Airline Park Blvd between W. Metairie and W. Napoleon. This major multi-year project oversaw the completion of a new drainage system including underground pipes/culverts below Airline Park Blvd, new drainage pump stations at both W. Metairie and W. Napoleon canals, new sidewalks, new driveway aprons. Move right in. Your new home awaits!",
