          "name": null,
          "baths_half": null,
          "text": "MUST SEE!! Beautiful 2 story home on a dead-end street in Metairie is centrally located and convenient to park, schools, hospital, restaurants, grocery and shopping. This family home offers 5 bedrooms and 3 full baths, plantation shutters throughout, and hurricane shutters. The galley kitchen featuring granite counter tops and stainless-steel appliances offers plenty of counter space and a pantry. The kitchen opens into the living and dining room for a seamless and inviting entertaining experience. The bonus room is located just off the living room and could be used as an office, formal sitting room or playroom. The large primary suite located on the main floor has 2 walk-in closets, and a spacious bathroom featuring quartz countertops, a stand-up shower and soaker tub. Two guest rooms with large closets are also located downstairs, along with a shared bathroom. The laundry room located on the main floor includes a utility sink, granite countertop with storage, and supports gas or electric hookups. Two additional large guest rooms with walk-in closets are located upstairs with a shared bathroom. A large tranquil saltwater pool, soothing spa, covered patio, in ground sound system, and luscious landscaping on this oversized lot make this backyard a true oasis and private paradise. The detached 2-car garage offers extended outside entertainment with seating and workout area.",
