          "name": null,
          "baths_half": null,
          "text": "This well-cared-for home has been owned by the original family for three generations. On an oversized 80 x 120 corner lot in a highly desired location, the property features a two-car garage with carport and storage unit attached, 30-Year roof less than two years old w/ terracotta style ridges, and water heater less than 5 years old. The garage is open to all possibilities by including a running toilet, utility sink, washer/dryer hookups, and the storage unit is large enough for a boat and equipment. The lot is bordered by a low brick wall with ornate rod iron. The floorplan of the home allows for maximum space and easy renovation with large windows for ample natural light and a large main bedroom measuring 13.5 x 11.5. The home features original hardwood flooring and the kitchen has newer tile with a washer/dryer inset and sizable pantry. The possibilities await for you to make this your home today!",
