          "baths_half": 1,
          "text": "Gorgeous light filled newly renovated 3 story townhouse with 3rd floor bonus area that could be a 4th bedroom or guest suite. Three bedrooms, 3 full baths with a downstairs powder room, open concept kitchen and an indoor fresh air atrium with wall fountain. Formal dining room has wainscoting and a custom silvered ceiling. The tranquil living room features a wood burning fireplace, engineered wood flooring, recessed lighting and floor to ceiling glass wall overlooking the white plastered open-air atrium with Zen fountain rock wall. Second floor primary suite with built-in walk-in closet features a reconfigured spa like bath with oversize walk-in shower, floating dual vanity with marble floors. The front second floor bedroom has a large walk-in closet and access to a copper floored balcony. The third bedroom has abundant natural light from an oversize fixed window overlooking the interior courtyard and fountain. The shared second floor bath boasts all new fixtures, floating vanity, new tub and shower tile and new penny floor tile. Both the second and third floors are newly carpeted. The expansive third floor bonus area with full bath and wet bar with refrigerator could be a home office, additional living area or configured into a guest suite or 4th bedroom. A two-car garage is accessed via the living room and rear common driveway. Renovation encompassed new paint, flooring, cabinetry, counters, fixtures, appliances, lighting and appliances. Beautifully landscaped raised front garden. Roof is 1 year old. AC units date to 2019, 2021 and 2022. Seller is a Louisiana licensed real estate agent.",
