          "text": "Mid-century modern beauty with stunning updates and Architectural Digest interiors. So much to love like wide-plank flooring, handmilled and custom painted coffered walls, giant windows, specialty wallpaper and premium tiling. Plus inset lighting upgrades and propellor fans throughout. The upscale comfort vibe is visible from the large living room through to the heart of the home which includes a gourmet kitchen with slab stone counters and backsplash, ceramic farmhouse apron sink, high-end stainless appliances, a butler's pantry and bar with custom glass tile and wine fridge, and a great breakfast nook. Entertain in style in the adjoining dining room with wainscot and wallpaper walls overlooking a beautiful backyard and the covered patio. Your spacious owner's suite features a frameless glass spa shower with unique tile inset nook and a walk-in diva closet. You'll want to live overlooking the lush lawn of the privacy fenced backyard: whether on the covered back deck, the BBQ extension area or out in the warm spring sun on the separate slab patio. A block from Girard Playground. This one's a gem!",
