          "text": "This home has been Immaculately kept and is in a prime location. This 3 bedroom, 2 bath expansive raised home is on an oversized corner lot! Convenient to a popular park, schools, highways, and playgrounds. It has a well thought out design with the private primary bedroom and en-suite on one end and the remaining beds and shared bath on the other. Built in 2007 by a pioneer in green energy efficient practices. The attic and the undercarriage are insulated for significant utility bill savings. One single owner/occupant ensured the homes maintenance and low impact use over the years which is reflected in its impressive condition. Enjoy an abundance of natural light, ample storage to keep things organized and almost 500 square feet of deck space for outdoor living. Park multiple cars, 2 in the garage and more in the driveway or perhaps a boat! BONUS: Option to buy furnished. Don't miss this opportunity. Contact us today for a showing!",
