          "baths_half": 1,
          "text": "OPEN HOUSE SUNDAY MARCH 24, 1-3 PM LOCATION LOCATION! Must see this WELL MAINTAINED HOME! Located on corner lot 60x110. This four bedroom spacious home features Primary Bedroom & bath located downstairs with walk-in closet. Upon entering in the foyer are marble floors. Extra wide staircase leading upstairs .Wood flooring in Living room & downstairs bedroom. Three upstairs bedrooms have carpet in excellent condition. Electric stove that has a gas line available to convert stove to gas, young 5 ton a/c. It features 12' raised ceiling in the Breakfast area with Skylights in Breakfast area. Ceramic Tile flooring in the Kitchen, Laundry room and Bathrooms. Utility tub & 2 closets in laundry room. Features a two car attached insulated garage door & walls. Security cameras outside. The custom Rockwood plantation shutters & double pane windows complete the package of a classic home with a ton of space & options ready for a new owner's personal touch. Well insulated & floored Walk-in attic. Low flood insurance. 30 Year dimensional Timberlane architect roof August 2022. Energy efficient Fiberglass front door with side lights. All exterior doors are energy efficient keeping utilities low. Updated energy efficient recessed lighting throughout entire home. Crown molding downstairs. No popcorn ceilings. This home is very functional. This home is Down the street, walking distance to LCMC, East Jefferson Hospital, coffee shops, shopping center, bus stops, schools, easy access to I-10. Must see Home! Move-in Ready!",
